import React, { useState } from 'react';
import propertiesData from "../public/properties.json";

// State variable 'criteria' to store the search criteria entered by the user
function SearchForm({ onSearch }) {
  const [criteria, setCriteria] = useState({
    type: 'any',  // Property type, default set to "any"
    minPrice: '',
    maxPrice: '',
    minBedrooms: '',
    maxBedrooms: '',
    dateAfter: '',
    dateBefore: '', // To filter properties between two dates
    postcode: ''
  });

  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent the default browser behavior of refreshing the page
    onSearch(criteria); // Call the parent-provided 'onSearch' function with the criterias
  };

  // Function to handle input changes in the form
  const handleChange = (e) => {
    const { name, value } = e.target;
    setCriteria(prev => ({
      ...prev,
      [name]: value
    }));
  };


  // Render the search form UI
  return (
    <form className="search-form" onSubmit={handleSubmit}>
      <div className="search-form-grid">

        {/* Dropdown to select property type */}
        <div className="form-group">
          <label htmlFor="type">Property Type</label>
          <select
            id="type"
            name="type"
            value={criteria.type}
            onChange={handleChange}
          >
            <option value="any">Any</option>
            <option value="house">House</option>
            <option value="flat">Flat</option>
          </select>
        </div>

        {/* Minimum price input */}
        <div className="form-group">
          <label htmlFor="minPrice">Min Price (£)</label>
          <input
            type="number"
            id="minPrice"
            name="minPrice"
            value={criteria.minPrice}
            onChange={handleChange}
          />
        </div>

        {/* Maximum price input */}
        <div className="form-group">
          <label htmlFor="maxPrice">Max Price (£)</label>
          <input
            type="number"
            id="maxPrice"
            name="maxPrice"
            value={criteria.maxPrice}
            onChange={handleChange}
          />
        </div>

        {/* Minimum bedrooms input */}
        <div className="form-group">
          <label htmlFor="minBedrooms">Min Bedrooms</label>
          <input
            type="number"
            id="minBedrooms"
            name="minBedrooms"
            value={criteria.minBedrooms}
            onChange={handleChange}
          />
        </div>

        {/* Maximum bedrooms input */}
        <div className="form-group">
          <label htmlFor="maxBedrooms">Max Bedrooms</label>
          <input
            type="number"
            id="maxBedrooms"
            name="maxBedrooms"
            value={criteria.maxBedrooms}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="dateAfter">Added After</label>
          <input
            type="date"
            id="dateAfter"
            name="dateAfter"
            value={criteria.dateAfter}
            onChange={handleChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="postcode">Postcode Area</label>
          <input
            type="text"
            id="postcode"
            name="postcode"
            value={criteria.postcode}
            onChange={handleChange}
            placeholder="e.g. NW1"
          />
        </div>

        <div className="form-group">
          <button type="submit" className="search-button">
            Search Properties
          </button>
        </div>
      </div>
    </form>
  );
}

export default SearchForm;
